import React, { useState, useEffect } from "react";
import "./App.css";

function App() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [token, setToken] = useState("");
  const [latestData, setLatestData] = useState(null);
  const [historyData, setHistoryData] = useState([]);
  const [isRegister, setIsRegister] = useState(false);

  const handleAuth = async (url, successMessage) => {
    try {
      const response = await fetch(`http://localhost:3001/api/${url}`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ username, password }),
      });

      const data = await response.json();
      if (response.ok) {
        if (url === "login") {
          setToken(data.token);
          setIsAuthenticated(true);
        }
        alert(successMessage);
      } else {
        alert(data.message || "Error occurred");
      }
    } catch (error) {
      console.error("Error:", error);
      alert("Error occurred");
    }
  };

  useEffect(() => {
    if (isAuthenticated) {
      fetch("http://localhost:3001/api/temperature", {
        headers: { Authorization: token },
      })
        .then((response) => response.json())
        .then(setLatestData)
        .catch((error) => console.error("Error fetching latest data:", error));

      fetch("http://localhost:3001/api/history", {
        headers: { Authorization: token },
      })
        .then((response) => response.json())
        .then(setHistoryData)
        .catch((error) => console.error("Error fetching historical data:", error));
    }
  }, [isAuthenticated, token]);

  return (
    <div className="App">
      {!isAuthenticated ? (
        <div className="auth-container">
          <h2>{isRegister ? "Register" : "Login"}</h2>
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <button
            onClick={() =>
              handleAuth(isRegister ? "register" : "login", isRegister ? "Registered successfully!" : "Logged in successfully!")
            }
          >
            {isRegister ? "Register" : "Login"}
          </button>
          <a
            className="toggle-auth"
            onClick={() => setIsRegister(!isRegister)}
          >
            {isRegister ? "Switch to Login" : "Switch to Register"}
          </a>
        </div>
      ) : (
        <div>
          <h1>Temperature and Humidity Monitor</h1>
          <section>
            <h2>Latest Data</h2>
            {latestData ? (
              <div>
                <p>Temperature: {latestData.temperature}°C</p>
                <p>Humidity: {latestData.humidity}%</p>
                <p>Timestamp: {new Date(latestData.timestamp).toLocaleString()}</p>
              </div>
            ) : (
              <p>Loading...</p>
            )}
          </section>
          <section>
            <h2>Historical Data (Last 50 Records)</h2>
            {historyData.length > 0 ? (
              <table>
                <thead>
                  <tr>
                    <th>Timestamp</th>
                    <th>Temperature (°C)</th>
                    <th>Humidity (%)</th>
                  </tr>
                </thead>
                <tbody>
                  {historyData.map((record, index) => (
                    <tr key={index}>
                      <td>{new Date(record.timestamp).toLocaleString()}</td>
                      <td>{record.temperature}</td>
                      <td>{record.humidity}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            ) : (
              <p>Loading...</p>
            )}
          </section>
        </div>
      )}
    </div>
  );
}

export default App;
